import Header from "./Header";
import {Link} from 'react-router-dom';

function Signup(){
    return (
        <div>
            <Header/>
            Welcome to signup page
            <br></br>
            USERNAME
            <input type="text" />
            <br></br>
            PASSWORD
            <br></br>
            <input type="password"/>
            <br></br>
            <button >SIGNUP</button>
            <Link to="/login">LOGIN</Link>
        </div>
    )
}
export default Signup;
